import Taro, { Component } from "@tarojs/taro";
import { View, Image } from "@tarojs/components";
import { connect } from "@tarojs/redux";
import { updateBranchesWithDBQuery } from "../../actions/index";
import indexBottomImage from "../../assets/images/start_bottom.png";
import "./index.scss";
import BranchSelector from "../../components/branch-selector/index.weapp";

const indexTopImage =
  "data:image/jpeg;base64,";

@connect(
  state => ({
    branches: state.branches
  }),
  dispatch => ({
    dispatchUpdateBranchesWithDBQuery(latitude, longitude) {
      dispatch(updateBranchesWithDBQuery(latitude, longitude));
    }
  })
)
export default class Index extends Component {
  componentDidMount() {
    if (this.props.branches && this.props.branches.length == 0) {
      Taro.getLocation({
        success: res => {
          this.props.dispatchUpdateBranchesWithDBQuery(
            res.latitude,
            res.longitude
          );
        }
      });
    }
  }

  render() {
    return (
      <View
        className='index'
        style={{
          height: "100vh"
        }}
      >
        <View
          className='branch-selector-wrapper'
          style={{
            display: "flex",
            flexDirection: "column",
            width: "100%",
            height: "100%",
            justifyContent: "center",
            backgroundImage: `url("${indexTopImage}")`,
            backgroundSize: "cover"
          }}
        >
          <BranchSelector branches={this.props.branches}></BranchSelector>
        </View>
        <Image
          src={indexBottomImage}
          mode='scaleToFill'
          style={{ position: "absolute", bottom: "0", width: "100vw" }}
        />
      </View>
    );
  }
}
